import 'package:flutter/material.dart';class SignUpScreen extends StatefulWidget {  const SignUpScreen({super.key});  @override  State<SignUpScreen> createState() => _SignUpScreenState();}class _SignUpScreenState extends State<SignUpScreen> {  final TextEditingController emailController = TextEditingController();  final TextEditingController nameController = TextEditingController();  final TextEditingController userNameController = TextEditingController();  final TextEditingController phoneController = TextEditingController();  final TextEditingController passwordController = TextEditingController();  @override  void dispose() {    emailController.dispose();    nameController.dispose();    userNameController.dispose();    phoneController.dispose();    passwordController.dispose();    super.dispose();  }  @override  Widget build(BuildContext context) {    return Scaffold();  }}